    return (

        <MDBBtn className='circle' floating social="tw" size="lg">
        <MDBIcon fab icon="twitter" className="pr-1" />
      </MDBBtn>

    );
  }

const Header = (props) => {
return( 
<div className="container">
<div className="header">
    <button type="button" class="btn btn-dark btn-circle btn-xl" onClick= {() =>props.onclick(1)}><i class="fa fa-question"></i></button> 
    <SocialButtonsPage />
</div>
</div>
) }

export default Header
